import { Card, Tag, Input, Checkbox, Select, message, Table } from 'antd';
import 'antd/dist/antd.css';

export class App extends Component {

  render() {
    return (
      <div>
        <div>
          <h1>Section 1</h1>
        </div>
        <div>
        <h1>Section 2</h1>
        </div>
      </div>
    )
  }
}

export default App
